import React from 'react'
import ReactDOM from 'react-dom'
import style from './css/main.css'


class App extends React.Component{

    state = {
        searchValue: ''
    }

    changeValue =  (e) =>{
        var rslt =e.target.value
        this.setState({searchValue : rslt})

    }

    render() {
        return(
            <div className='form'>
                <label> Search Your Recipe</label>
                <form>
                    <p> {this.state.searchValue}</p>
                    <input type='text' id='a' onChange={this.changeValue}  />
                    <button> Search </button>    
                </form> 
            </div>
        )
    }
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
);
